import React, { useEffect, useState } from 'react';
import axios from 'axios';

const CallLogTable = () => {
  const [callData, setCallData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');

  useEffect(() => {
    const fetchCallLogs = async () => {
      try {
        const response = await axios.get('http://localhost:3005/getcall-log');
        setCallData(response.data);
        setFilteredData(response.data); // Set filteredData initially to display all
      } catch (error) {
        console.error('Error fetching call logs:', error);
      }
    };

    fetchCallLogs();
  }, []);

  // Function to handle search
  const handleSearch = (e) => {
    const query = e.target.value;
    setSearchQuery(query);

    const filtered = callData.filter((call) =>
      call.employeeId.toLowerCase().includes(query.toLowerCase()) ||
      call.callDetails.toLowerCase().includes(query.toLowerCase()) ||
      new Date(call.timestamp).toLocaleString().toLowerCase().includes(query.toLowerCase())
    );

    setFilteredData(filtered);
  };

  // Function to delete a single call log
  const handleDelete = async (id) => {
    const confirmDelete = window.confirm("Do you really want to delete this call log?");
    if (confirmDelete) {
      try {
        await axios.delete(`http://localhost:3005/delete-call-log/${id}`);
        setCallData(callData.filter(call => call._id !== id)); // Update state after deletion
        setFilteredData(filteredData.filter(call => call._id !== id));
      } catch (error) {
        console.error('Error deleting call log:', error);
      }
    }
  };

  // Function to delete all call logs
  const handleDeleteAll = async () => {
    const confirmDelete = window.confirm("Do you really want to delete all call logs?");
    if (confirmDelete) {
      try {
        await axios.delete('http://localhost:3005/delete-all-call-logs');
        setCallData([]); // Clear state after deletion
        setFilteredData([]);
      } catch (error) {
        console.error('Error deleting all call logs:', error);
      }
    }
  };

  return (
    <div className="overflow-x-auto">
      <div className="flex justify-between items-center">
        <input
          type="text"
          placeholder="Search by Employee ID or Call Details..."
          className="transition rounded-sm mt-4 border border-blue-700 p-3 w-60"
          value={searchQuery}
          onChange={handleSearch}
        />
        <button
          onClick={handleDeleteAll}
          className="bg-red-500 text-white p-2 rounded mt-4"
        >
          Delete All Call Logs
        </button>
      </div>

      <table className="min-w-full bg-white rounded-lg shadow-md mt-4">
        <thead>
          <tr className="bg-gray-200 text-gray-600 uppercase text-sm leading-normal">
            <th className="py-3 px-6 text-left">Sl. No.</th>
            <th className="py-3 px-6 text-left">Employee ID</th>
            <th className="py-3 px-6 text-left">Call Details</th>
            <th className="py-3 px-6 text-left">Timestamp</th>
            <th className="py-3 px-6 text-left">Actions</th>
          </tr>
        </thead>
        <tbody className="text-gray-600 text-sm font-light">
          {filteredData.length > 0 ? (
            filteredData.map((call, index) => (
              <tr key={call._id} className="border-b border-gray-200 hover:bg-gray-100">
                <td className="py-3 px-6 text-left">{index + 1}</td>
                <td className="py-3 px-6 text-left">{call.employeeId}</td>
                <td className="py-3 px-6 text-left">{call.callDetails}</td>
                <td className="py-3 px-6 text-left">{new Date(call.timestamp).toLocaleString()}</td>
                <td className="py-3 px-6 text-left">
                  <button
                    onClick={() => handleDelete(call._id)}
                    className="bg-red-500 text-white px-3 py-1 rounded"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="5" className="py-3 px-6 text-center">No matching results found</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default CallLogTable;
